# 将图片资源打包成base64

import sys
import os
import base64

def toBase64(imagePath):
    with open(imagePath,'rb') as f:
        image = base64.b64encode(f.read())
        print(image)
        return image

def fromBase64(imageB64):
    return base64.b64decode(imageB64)


